import React from 'react';
import './Login.css'; 

import { useNavigate } from 'react-router-dom';

function Login() {
  const navigate = useNavigate();

  return (
    <div className="login-container">
      {}
      <div className="login-buttons">
        <button className="login-btn admin" onClick={() => navigate('/admin')}>Login as Admin</button>
        <button className="login-btn teacher" onClick={() => navigate('/teacher')}>Login as Teacher</button>
        <button className="login-btn student" onClick={() => navigate('/student')}>Login as Student</button>
        <button className="login-btn parent" onClick={() => navigate('/parent')}>Login as Parent</button>
      </div>
      {}
    </div>
  );
}

export default Login;
